import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <nav id="navigation">
        <div id="logoNav">
          <img src="" alt="" />
        </div>
        <div id="websiteName">
          <h1><NavLink to={'/'}><a>Viddev</a></NavLink></h1>
        </div>
        <div id="navLinks">
            <ul>
                <li><NavLink to={'/tvshows'}>Tv Shows</NavLink></li>
                <li><NavLink to={'/movies'}>Movies</NavLink></li>
                <li><NavLink to={'/recentlyadd'}>Recently Added</NavLink></li>
                <li><NavLink to={'/mylist'}><a>My List</a></NavLink></li>
            </ul>
        </div>
      </nav>
    </header>
  );
};

export default Header;
